            const response =  await axios.post('http://localhost:8000/api/buy/land/pin',{location:formData.location})
            Setfinalres(response.data[0]) 
            console.log(response);
            Setsubmitted(true)
            console.log(`submitted`);
        }
        catch(e){
            console.log('error happened',e);
        }
